import React, { useState } from 'react'

import {
  Button,
  IconHome,
  IconUser,
  IconTeam,
  ContainerTab,
  TabBar,
  ContainerButtons,
  ContainerVirtualButtons,
  IconVip,
  IconSign,
} from '../../styles/components/Navigation'

export const Navigation = () => {
  const [animate, setAnimate] = useState(false)

  return (
    <>
      <ContainerTab>
        <ContainerButtons>
          <ContainerVirtualButtons>
            <IconVip />
            <IconTeam />
            <Button
              animate={animate}
              onClick={() => {
                setAnimate(true)
                setTimeout(() => {
                  setAnimate(false)
                }, 100)
              }}
            >
              <IconHome />
            </Button>
            <IconUser />
            <IconSign />
          </ContainerVirtualButtons>
        </ContainerButtons>
        <TabBar />
      </ContainerTab>
    </>
  )
}
